    false,nt"url": null,nt"notes": "The Southern Watersheds includes the drainages
    of the Northwest River, the North Landing River, and Back Bay in the southeastern
    corner of Virginia. Common reedgrass is an invasive wetland plant which threatens
    to significantly alter the structure and function of the marshes and other wetlands
    of the Southern Watersheds. The objectives of this project are to increase public
    awareness of the common reedgrass problem in the Southern Watersheds, demonstrate
    effective control of common reedgrass,and encourage measures that prevent common
    reedgrass from becoming invasive. The project is funded by the United States Environmental
    Protection Agency, the United States Fish and Wildlife Service, Back Bay Restoration
    Foundation, and the Virginia Department of Conservation and Recreation. Additionally,
    fifteen other local, state, federal, and private entities are involved in the project
    as participants or advisors. The following account details activities related to
    the Southern Watersheds Common Reedgrass Project from the period of March 1, 1993,
    to October 20, 1993.",nt"license_title": "License Not Specified",nt"extras":
